import styled from 'styled-components';
import { List, Button } from 'antd';

export const FollowListStyle = styled(List)`
    margin-bottom : 20px;
`

export const FollowListItem = styled(List.Item)`
    margin-top : 20px;
`

export const MoreBtn = styled(Button)`
    width : 90%;
    margin-left : 5%;
    margin-bottom : 15px;
`

export const TitleText = styled.div`
    font-size : 16px;
    font-weight : 600;
    color : #1890ff;
    margin-left : 5px;
`
